import React from 'react';
import '../styles/CandidateJourney.css'; // Make sure to create this CSS file

function CandidateJourney() {
    return (
        <article className="candidate-journey">
            <h2>Your Journey to Success</h2>
            <p>
                Starting your academic journey can seem daunting, but with AfroTouch Education,
                you have a partner every step of the way. Here's how we help you transition from 
                application to settling in Estonia or Latvia:
            </p>
            <ol>

                <li><h3><strong>Acceptance</strong></h3>Once accepted, we assist with the necessary paperwork, visa application, and preparation for your move.</li>
                <li><h3><strong>Settling In</strong></h3> Upon arrival, AfroTouch Education is there to help you get settled into your new home and start your studies.</li>
                <li><h3><strong>Continued Support</strong></h3> Our support doesn't end as you begin your studies; we're here to help you throughout your educational journey.</li>
            </ol>
            <p>
                Ready to start your journey? Apply now and take the first step towards a world-class education in the Baltics.
            </p>
        </article>
    );
}

export default CandidateJourney;
